      | 365453 -> { ItemTypeData.id= 365453; name= "'Doomcradle' BK-42 Assault Combat Rifle"; published= false; description= "A gas-operated, short-barreled weapon, the combat rifle is a semi-automatic weapon well-suited to both short and medium range combat. Classified as a light support weapon, it is typically employed in target-rich environments where the high volume of fire produced enables operators to engage multiple targets in rapid succession, whilst the weapon’s extended range keeps the operator just beyond the threat threshold of most standard assault rifles.    Its advanced bullpup configuration reduces weapon weight and improves maneuverability making it the ideal cross-over weapon for urban and field combat. The modular design has more practical advantages as well in that it’s cheap to maintain and easily replaced if damaged, making it one of the most reliable weapons in service today."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365938 -> { ItemTypeData.id= 365938; name= "'Logicloop' Scout M-I"; published= false; description= "The Scout dropsuit is a lightweight suit optimized for enhanced mobility, multi-spectrum stealth, and heightened awareness. Augmented joint servo motors give every movement extra speed and flexibility, while integrated friction and impact dampening materials reduce the overall sound signature.     Biotic augments make this suit ideal for a melee-focused role. Woven into the suit, a tremor membrane saturates muscles with nutrients amplifying the cross-sectional force of physical strikes. Combined with rigorous training, this temporarily enhanced strength and dexterity make the Minmatar Scout almost unmatched in hand-to-hand combat.     When missions call for speed and stealth, situations in which heavily armored suits would be more of a burden than an advantage, a scout dropsuit is the best option. The enhanced mobility it provides makes up for its relatively low protection, and when combined with stealth technology modules, the scout suit is the obvious choice for infiltration, counter-espionage, and assassination."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366229 -> { ItemTypeData.id= 366229; name= "Faction Booster Amarr (3-Day)"; published= false; description= "Faction boosters are biometric identification chips issued by major factions throughout New Eden. Once activated they uniquely identify the user as a supporter of the issuing faction. Corporations operating on behalf of the faction will then be authorized to increase rewards to that individual."; marketGroupId= None; groupId= 354641; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
      | 366423 -> { ItemTypeData.id= 366423; name= "Imperial Sentinel ak.0"; published= false; description= "The Sentinel dropsuit is a second-generation solution designed to withstand concentrated small arms fire and protect the wearer from the concussive, thermal, and impact forces of low-grade explosives. Additionally, its power-assisted exoskeleton facilitates usage of the heaviest caliber personal weapons.    Every vital area of the wearer is protected by 25mm of composite ceramic shell or high tensile steel plates, layered with impact absorbing, compressed carbon latticework. A secondary thermal dispersion membrane channels excess heat away from the point of contact, distributing it over a larger surface area and thereby lessening the potential damage. Superconductive veins of hybrid silver coat the outer layers and connect every piece of the armor to a grounding heat sink, dampening the harmful effects of direct fire electromagnetic weaponry.    Heavy frame dropsuits lack the mobility of lighter suits, but this trade-off results in a defensive system that defies standard infantry conventions. No other classification of personal armor can claim to be able to stand toe-to-toe with enemy vehicles and survive."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
